Ｌ．Ａから入荷いたしました！！<br>
<br><br>
アバークロンビー＆フィッチAbercrombie & Fitchは1892年にデービット・アバクロンビーにより設立されたニューヨーク発のアパレルブランドです。<br>
キャンプ、釣り、狩猟等の用品の専門店としてスタートしました。<br>
現在ではハリウッドスター、スポーツ選手などのセレブに人気があることで有名です。<br>
好みのプリント、色、サイズが見つかるのも人気の秘密で飽きの来ないデザインで、生地も丈夫なため何年でも愛用できることが特長です。<br>


<p><font color="#ff0000">画面上と実物では多少色具合が異なって<br>見える場合もございます。ご了承ください。<br>この商品は当店実店舗でも販売しております。<br>在庫数の更新は随時行っておりますが、<br>お買い上げいただいた商品が、品切れになってしまうこともございます。<br>
あらかじめご了承ください。</font>



